import React from "react";
import s from './Dialogs.module.css';
function Dialogs(){
    return(
        <div className={s.content}>
            <div className={s.dialogs}>
            <h1>Dialogs</h1>
                <ul>
                    <li>Yaroslav</li>
                    <li>Alex</li>
                    <li>Veronika</li>
                    <li>Grandma</li>
                    <li>Grandpa</li>
                    <li>Kaneki</li>
                    <li>Naruto</li>
                    <li></li>
                </ul>
            </div>
        </div>
    )
}
export default Dialogs;
